<?php

namespace SwagEmotionPresetExample\Components\Emotion\Presets;

use Shopware\Components\Emotion\Preset\PresetMetaDataInterface;
use SwagEmotionPresetExample\SwagEmotionPresetExample;

class MyCustomPreset implements PresetMetaDataInterface
{
    /**
     * @return string
     */
    public function getName()
    {
        return 'my_custom_preset' . uniqid();
    }

    /**
     * @return bool
     */
    public function getPremium()
    {
        return false;
    }

    /**
     * @return bool
     */
    public function getCustom()
    {
        return false;
    }

    /**
     * @return string
     */
    public function getThumbnail()
    {
        return 'data:image/png;base64,';
    }

    /**
     * @return string
     */
    public function getPreview()
    {
        return 'data:image/png;base64,';
    }

    /**
     * @return array
     */
    public function getTranslations()
    {
        return [
            ['label' => 'My custom preset', 'description' => 'Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua.', 'locale' => 'gb_GB'],
            ['label' => 'Meine Beispiel-Vorlage', 'description' => 'Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua.', 'locale' => 'de_DE'],
        ];
    }

    /**
     * @return array
     */
    public function getPresetData()
    {
        $json = SwagEmotionPresetExample::getJsonData('MyCustomPreset.json');
        return json_decode($json, true);
    }

    /**
     * @return array
     */
    public function getRequiredPlugins()
    {
        return [];
    }

    /**
     * @return bool
     */
    public function getAssetsImported()
    {
        return false;
    }
}
